import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/checkout"></Route>
          <Route path="/login"></Route>
          <Route path="/"></Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
